    "#РІРѕР·СЊРјРµРј С‡Р°СЃС‚СЊ РґР°РЅРЅС‹С… Рё РїРѕСЃС‚СЂРѕРёРј РјР°С‚СЂРёС†Сѓ РєРѕСЂСЂРµР»СЏС†РёР№------------------------------------------------\n",
    "def drop_corr_col(df, treshold , persent ):\n",
    "    # n РІС‹Р±РёСЂР°РµС‚СЃСЏ РЅР° РєР°РєРѕР№ РІС‹Р±РѕСЂРєРµ СЃС‚СЂРѕРёС‚СЊ РєРѕСЂСЂРµР»СЏС†РёРё РІ РїСЂРѕС†РµРЅС‚Р°С…\n",
    "    a = [random.choice(df.index) for i in xrange(int(len(df)*persent))]\n",
    "    tmp = df.iloc[a]\n",
    "    tmp.fillna(0, inplace=True)\n",
    "    to_drop_after_corr = pd.DataFrame(tmp.corr())\n",
    "    upper = tmp.where(np.triu(np.ones(tmp.shape), k =1).astype(np.bool))\n",
    "    to_drop = [column for column in upper.columns if any(upper[column]> treshold)]\n",
    "    df.drop(to_drop, axis =1)\n",
    "    return df, to_drop\n",
    "\n",
    "\n",
    "\n",
    "# Р”Р»СЏ РѕР±СѓС‡РµРЅРёСЏ Рё РІР°Р»РёРґР°С†РёРё СЃРґРµР»Р°РµРј РґР°СѓРЅСЃСЌРјРїР»РёРЅРі РєР»Р°СЃСЃРѕРІ------------------------------------------------\n",
    "def dawnsampling(df, target):  \n",
    "\n",
    "    # РїСЂРѕРїСѓСЃРєРё NaN Р·Р°РїРѕР»РЅРёРј РЅСѓР»СЏРјРё, С‚.Рє. СЌС‚Рѕ РїСѓСЃС‚Рµ Р·РЅР°С‡РµРЅРёСЏ\n",
    "    df.fillna(0, inplace=True)\n",
    "    \n",
    "    df_majority = df[df[target] ==0]\n",
    "    df_minority = df[df[target]==1]\n",
    "\n",
    "    df_majority_downsampled = resample(df_majority, replace=False, n_samples= len(df_minority)*3 , random_state=42) \n",
    "    df_downsampled = pd.concat([df_majority_downsampled, df_minority])\n",
    "    #print(df_downsampled.target.value_counts()) \n",
    "    return df_downsampled\n",
    "\n",
    "\n",
    "# РїРѕСЃРјРѕС‚СЂРµС‚СЊ РЅР° С„РёС‡Рё, РіРґРµ РѕС‚ 2 РґРѕ 5 Р·РЅР°С‡РµРЅРёР№. РЇРІР»СЏСЋС‚СЃСЏ Р»Рё РѕРЅРё РєР°С‚РµРіРѕСЂРёР°Р»СЊРЅС‹РјРё?------------------------------------------------\n",
    "def check_for_cut_feat(df, nmin, nmax): \n",
    "    a=[]\n",
