    "# РџРѕСЃС‚СЂРѕРёРј random forest РґР»СЏ РёСЃРєР»СЋС‡РµРЅРёСЏ РЅРµ РІР°Р¶РЅС‹С… РїСЂРёР·РЅР°РєРѕРІ------------------------------------------------\n",
