    "    lift_xgb = pd.concat([sa_scaled, scores_xgb],axis=1)\n",
    "    gains1 = gains(lift_xgb,['DECILE'],'TARGET','SCORE')\n",
    "    agg_oot = gains1[['DECILE', 'DIST_TAR', 'LIFT']]\n",
    "\n",
    "    agg_oot[['DIST_SCORE', 'LIFT2']] = gains2[['DIST_TAR', 'LIFT']]\n",
    "    \n",
    "    return fpr_oot_lr, tpr_oot_lr,  fpr_oot_xgb, tpr_oot_xgb, gini_oot_lr, gini_oot_xgb, agg_oot, \n",
